import React from "react";
import InputBoxTest from "./InputBoxTest";
import OutputBoxTest from "./OutputBoxTest";

function Test1(props) {
    function handler(someValue) {
        this.setState({
          someVar: someValue
        })
      }

  return (
    <>
      <div className="row">
        <div className="container-fluid col-sm-7">
          <InputBoxTest handler={props.text} />
        </div>
        <div className="col-sm-5">
          <OutputBoxTest outText={props.text} />
        </div>
      </div>
    </>
  );
}

export default Test1;
